import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

// ✅ Pages and Components
import Navbar from "./components/Navbar";
import Home from "./pages/Home";
import ComplaintForm from "./pages/ComplaintForm";
import AdminDashboard from "./pages/AdminDashboard";
import Analytics from "./pages/Analytics";
import TrackStatus from "./pages/Trackstatus";// ✅ Correct casing
import VoiceComplaint from "./pages/VoiceComplaint";
import AdminLogin from "./pages/AdminLogin";
import ProtectedRoute from "./components/ProtectedRoute";
import ComplaintChoice from "./pages/ComplaintChoice";
import UserLogin from "./pages/UserLogin";
import UserOptions from "./pages/UserOptions";

export default function App() {
  return (
    <Router>
      <div className="bg-gray-50 min-h-screen font-sans">
        <Navbar />
        <Routes>
          {/* Public Routes */}
          <Route path="/" element={<Home />} />
          <Route path="/user-login" element={<UserLogin />} />
          <Route path="/complaint" element={<ComplaintForm />} />
          <Route path="/complaint-choice" element={<ComplaintChoice />} />
          <Route path="/voice" element={<VoiceComplaint />} />
          <Route path="/track" element={<Trackstatus />} />
          <Route path="/admin-login" element={<AdminLogin />} />
          <Route path="/analytics" element={<Analytics />} />

          {/* User Options After Login */}
          <Route path="/user-options" element={<UserOptions />} />
          <Route path="/voice-complaint" element={<VoiceComplaint />} />
          <Route path="/written-complaint" element={<ComplaintForm />} />
          <Route path="/track-complaint" element={<Trackstatus />} />

          {/* Admin Route (Protected) */}
          <Route
            path="/admin"
            element={
              <ProtectedRoute>
                <AdminDashboard />
              </ProtectedRoute>
            }
          />
        </Routes>
      </div>
    </Router>
  );
}
